function readyFn(jQuery) {

	"use strict";

	jQuery('#slide_menu_list .mega_menu > ul > li ul').each(function() {
		// save
		var $a=jQuery(this).children('li');
		// Move
		jQuery($a.parent().parent()).after($a);
		// Delete
		jQuery(this).remove();
	});
	jQuery('#slide_menu_list .mega_menu').removeClass("mega_menu");
	jQuery("#slide_menu_list").mmenu();

	// play html5 video after mmenu apply
	// mmenu may cause html5 to stop playing
	jQuery('.creativity_video_shortcode').fadeIn(function() {
	    this.play();
	});

	// wrap all select with span they can accept css style
	jQuery('select').each(function() {
		// only wrap if they have no style
		if ( jQuery(this).css('display') != 'none' )
		{
		   jQuery(this).wrap( "<span class='creativity_select_container'></span>" );
		}
	});

	// apply fancybox
	jQuery(".fancybox").fancybox({
		prevEffect    : 'none',
		nextEffect    : 'none',
		closeBtn    : false,
		helpers   : {
		title : { type : 'inside' },
		buttons : {}
		}
	});

	// Main menu dropdown
	jQuery('.main_nav ul.navbar-nav > li, .main_nav ul.navbar-nav > li.default_menu li').hover(function(){
		var sub = jQuery(this).children('.dropdown-menu');
		if(sub.length > 0 && jQuery(window).width() > 992) {
			sub.stop().slideDown(200, 'easeOutCubic');
		}
	}, function(){
		var sub = jQuery(this).children('.dropdown-menu');
		if(sub.length > 0 && jQuery(window).width() > 992) {
			sub.stop().hide();
		}
	});

	// Cart icon dropdown menu for large screen
	jQuery('.creativity_cart_icon').hover(function(){
		var sub = jQuery(this).children('.dropdown-menu');
		if(sub.length > 0 && jQuery(window).width() > 992) {
			sub.stop().fadeIn();
		}
	}, function(){
		var sub = jQuery(this).children('.dropdown-menu');
		if(sub.length > 0 && jQuery(window).width() > 992) {
			sub.stop().fadeOut("fast");
		}
	});

	// Cart icon dropdown menu for small screen
	jQuery('.creativity_cart_icon').click(function(event){
		var sub = jQuery(this).children('.dropdown-menu');
		if(sub.length > 0 && jQuery(window).width() < 992) {
			sub.stop().show();
			jQuery(document).bind( "mouseup touchend", function(e){
				var container = sub;
				if (!container.is(e.target) // if the target of the click isn't the container...
				&& container.has(e.target).length === 0) // ... nor a descendant of the container
				{
					container.hide();
				}
			});
			event.preventDefault();
		}
	});


	// Default tooltip and client image tooltip
	jQuery('[data-toggle="tooltip"]').tooltip();
	jQuery('.clients_grid.clients_tooltip .clients_item img').tooltip();

	// Apply one page scroll if it's set in the page
	if (jQuery(".one_page_scroll .page_builder_template").length > 0) {
		jQuery('.one_page_scroll .page_builder_template').fullpage({
			//Navigation
			menu: false,
			navigation: true,
			navigationPosition: 'right',
			slidesNavigation: true,
			slidesNavPosition: 'bottom',

			//Scrolling
			css3: true,
			scrollingSpeed: 600,
			autoScrolling: true,
			scrollBar: false,
			easing: 'easeInQuart',
			easingcss3: 'ease',
			continuousVertical: false,
			scrollOverflow: true,
			touchSensitivity: 15,
			normalScrollElementTouchThreshold: 5,

			//Accessibility
			keyboardScrolling: true,
			animateAnchor: true,
			recordHistory: false,

			//Design
			controlArrows: true,
			verticalCentered: true,
			resize : false,
			responsive: 945,

			//Custom selectors
			sectionSelector: '.new_section',
			slideSelector: '.new_slide',
		});
	}

	// add nav class to widget custom menu so it can be used for spyscroll
	jQuery('.widget_nav_menu ul.menu').addClass('nav');
  	
  	// check header height to use it in scrollspy offset
  	// to assure no data are hidden behind header
	var current_header_height = jQuery('.site_header.fixed_header.unsticky_header').height() + jQuery('#wpadminbar').height();

	// if link with anchor target in the page clicked, animate scroll to the target ID
	jQuery('.menu.nav a[href^="#"], .navbar-nav.nav a[href^="#"]').not('.portfolio_filter_options a, a[href="#"], .mobile_menu_target').on('click',function (e) {
		var target = this.hash;
		var $target = jQuery(target);

		jQuery('html, body').stop().animate({
			'scrollTop': $target.offset().top-current_header_height
		});

		e.preventDefault();
	});

	// apply scroll spy on all body elements
	jQuery('body').scrollspy({
		offset: current_header_height+30,
	});


	// apply countto counter start
	jQuery('.countto_number').each(function() {
		jQuery(this).counterUp({
		    delay: 10,
		    time: jQuery(this).attr('data-count-time')
		});
	});

	// apply fitvids to all video banners
	jQuery(".video_fit_container").not(".blog_posts_wrapper.filterable_wrapper .video_fit_container").fitVids();

	// scroll to content button
	jQuery(".go_to_main_content").click(function() {
		jQuery('html, body').animate({
			scrollTop: jQuery(".site_content").offset().top
		}, 800);
	});


	/* start expanded search jquery */
	jQuery(".header_search i").click(function() {
		jQuery(".header_search").addClass("expanded_search");
		jQuery(".header_search input[type='text']").focus();
	});


	// set hidden header height to tid up the header are
	var $header_height = jQuery('.site_header.default_header.fixed_header.unsticky_header').height();
	if (jQuery(".site_header.overlay_header.fixed_header").length > 0) {
		var $header_height = jQuery('.header_top').height();
	}else if ( jQuery(".site_header.overlapping_header.fixed_header").length > 0 && jQuery(window).width() < 992 ) {
		var $header_height = jQuery('.header_top').height() + jQuery('.header_below').height();
	}else if ( jQuery(".site_header.fixed_aside").length > 0 && jQuery(window).width() < 992 ) {
		var $header_height = jQuery('.fixed_aside.site_header .header_top').height();
	}
	jQuery('.fixed_header_height').css({ 'height' : $header_height  + "px" });

	// reset hidden header in case of screen size changed
	jQuery(window).resize(function () {
		var $header_height = jQuery('.site_header.default_header.fixed_header.unsticky_header').height();
		if (jQuery(".site_header.overlay_header.fixed_header").length > 0) {
			var $header_height = jQuery('.header_top').height();
		}else if ( jQuery(".site_header.overlapping_header.fixed_header").length > 0 && jQuery(window).width() < 992 ) {
			var $header_height = jQuery('.header_top').height() + jQuery('.header_below').height();
		}else if ( jQuery(".site_header.fixed_aside").length > 0 && jQuery(window).width() < 992 ) {
			var $header_height = jQuery('.fixed_aside.site_header .header_top').height();
		}
		jQuery('.fixed_header_height').css({ 'height' : $header_height  + "px" });
		jQuery(".site_header.fixed_header.sticky_header, .fixed_header_height.sticky_header").addClass("screen_resized");
	});

  	// if header is sticky and contains .fixed_header_class then change it on scroll
	jQuery(window).scroll(function() {
		if (jQuery(".site_header.fixed_header").length > 0) {
			var scrolling = jQuery(window).scrollTop();
			var header_height = jQuery('.fixed_header_height').height();
			var header_top_height = jQuery('.header_top').height() + 1;
			var logo_height = jQuery('.logo').height();

			if (scrolling > header_height) {
				jQuery('.site_header.fixed_header, .fixed_header_height.fixed_header').stop().addClass('sticky_header');
				jQuery('.site_header.fixed_header, .fixed_header_height.fixed_header').removeClass('unsticky_header');
				jQuery('.site_header.fixed_header').stop().animate({ "top": "-" + header_top_height + "px" }, 200 );
				jQuery('.site_header.fixed_header .first_header_wrapper .navbar .nav>li>a>i, .site_header.fixed_header  .first_header_wrapper .navbar .nav>li>a>img').removeClass('fadeInDown');
				jQuery('.site_header.fixed_header .first_header_wrapper .navbar .nav>li>a>i, .site_header.fixed_header  .first_header_wrapper .navbar .nav>li>a>img').stop().addClass('animated fadeOutUp');
				jQuery(".site_header.fixed_header .header_search").removeClass("expanded_search");
				jQuery('.site_header.fixed_header .header_button .search').removeClass('animated fadeInDown');
				jQuery('.site_header.fixed_header .header_button .search').addClass('animated fadeOutUpSearch');

				// logo replace
				if (jQuery(".sticky_logo").length > 0) {
					jQuery('.site_header.fixed_header .logo').removeClass('animated fadeInDown');
					jQuery('.site_header.fixed_header .sticky_logo').removeClass('animated fadeOutDown');
					jQuery('.site_header.fixed_header .logo').addClass('animated fadeOutUp');
					jQuery('.site_header.fixed_header .sticky_logo').addClass('animated fadeInUp');
					jQuery('.site_header.fixed_header .logo').css({ 'margin-top' : "-" + logo_height  + "px" });
				}
			} else if (scrolling < (header_height + 1)) {

				jQuery('.site_header.fixed_header').stop().animate({ "top": "0" }, 200 );
				jQuery('.sticky_header .first_header_wrapper .navbar .nav>li>a>i, .sticky_header .first_header_wrapper .navbar .nav>li>a>img').removeClass('fadeOutUp');
				jQuery('.sticky_header .first_header_wrapper .navbar .nav>li>a>i, .sticky_header .first_header_wrapper .navbar .nav>li>a>img').stop().addClass('animated fadeInDown');
				jQuery('.sticky_header .header_button .search').removeClass('animated fadeOutUpSearch');
				jQuery('.sticky_header .header_button .gototop').removeClass('animated fadeInUp');
				jQuery('.sticky_header .header_button .search').addClass('animated fadeInDown');
				jQuery('.sticky_header .header_button .gototop').addClass('animated fadeOutDown');

				// logo replace
				if (jQuery(".sticky_logo").length > 0) {
					jQuery('.site_header.fixed_header.sticky_header .logo').removeClass('animated fadeOutUp');
					jQuery('.site_header.fixed_header.sticky_header .logo').css('margin-top', '');
					jQuery('.site_header.fixed_header.sticky_header .sticky_logo').removeClass('animated fadeInUp');
					jQuery('.site_header.fixed_header.sticky_header .logo').addClass('animated fadeInDown');
					jQuery('.site_header.fixed_header.sticky_header .sticky_logo').addClass('animated fadeOutDown');
				}

				jQuery('.site_header.fixed_header, .fixed_header_height.fixed_header').addClass('unsticky_header');
				jQuery('.site_header.fixed_header.sticky_header, .fixed_header_height.fixed_header.sticky_header').removeClass('sticky_header');

				// reset header height in case of changed due to screen size change
				var $reset_header_height = jQuery('.site_header.default_header.fixed_header.unsticky_header.screen_resized').height();
				if (jQuery(".site_header.overlay_header.fixed_header.screen_resized").length > 0) {
					var $reset_header_height = jQuery('.header_top').height();
				}
				jQuery('.fixed_header_height.screen_resized').css({ 'height' : $reset_header_height  + "px" });
				jQuery('.fixed_header_height.screen_resized, .site_header.screen_resized').removeClass("screen_resized");

			}

			// show go to top button, if user start to scroll far from header
			if (scrolling > header_height*2) { 
				jQuery('.fixed_header .header_button .gototop').show();
				jQuery('.fixed_header .header_button .gototop').removeClass('animated fadeOutDown');
				jQuery('.fixed_header .header_button .gototop').addClass('animated fadeInUp');
			}
		}
	});


	// Go to top button
	jQuery('.gototop').click(function(){
		jQuery('html, body').animate({scrollTop: '0px'}, 800);
		return false;
	});
  

	// define fadeDelay function to be used in appear effect delay, or one_by_one effect
	jQuery.fn.fadeDelay = function(name, start) {
		var delay = start;
		return this.each(function() {
			jQuery(this).delay(delay).queue(function(next){
				jQuery(this).css('visibility', 'visible').addClass('animated ' + name);
				next();
			});
		});
	};

	// apply animate in case it's not a part of sorted effect
	jQuery("[data-animation]").not(".sorted_effect [data-animation]").appear(function() {
		var $animationName = jQuery(this).attr('data-animation');
		var $animationDelay = jQuery(this).attr('data-animation-delay');
		jQuery(this).fadeDelay($animationName, $animationDelay);
	});

	// apply one by one effect for everything inside sorted_effect class
	jQuery(".sorted_effect").appear(function() {
		if(jQuery(this).attr('set-animation')) {
			var $set_animation = jQuery(this).attr('set-animation');
			var delay = 100;
			jQuery(this).children().each(function() {
				var animationName = $set_animation;
				// jQuery(this).fadeDelay(animationName, delay);
				// delay = delay + 420;
				if(typeof( jQuery(this).children('[data-animation]').attr('data-animation') ) != 'undefined') {
					var $single_animation = jQuery(this).children('[data-animation]').attr('data-animation');
					animationName = $single_animation;
					jQuery(this).children('[data-animation]').fadeDelay(animationName, delay);
				}else if(typeof( jQuery(this).attr('data-animation') ) != 'undefined') {
					var $single_animation = jQuery(this).attr('data-animation');
					animationName = $single_animation;
					jQuery(this).fadeDelay(animationName, delay);
				}else{
					jQuery(this).fadeDelay(animationName, delay);
					delay = delay + 420;
				}
			});
		}else if(jQuery(this).find('[data-animation]')) {
			var delay = 100;
			jQuery(this).find('[data-animation]').each(function() {
				var $animationName = jQuery(this).attr('data-animation');
				jQuery(this).fadeDelay($animationName, delay);
				delay = delay + 420;
			});
		}
	});

	// apply animation on progress bars group
	jQuery(".progress.animated_progress").parent().appear(function() {
		var delay = 150;
		jQuery(this).find('.progress-bar.animated_progress_bar').each(function() {
			var finalWidth = jQuery(this).attr('aria-valuenow');
			var duration = finalWidth * 4;
			jQuery(this).delay(delay).queue(function(next){
				jQuery(this).animate({width: finalWidth+'%'}, duration).addClass(duration);
				next();
			});
			delay = delay + 150;
		});
	});

	// apply stellar parallax effect
	jQuery(window).stellar({
		horizontalOffset: 0,
		horizontalScrolling: false,
		responsive: true,
	});

	// make sure that filterable wrapper are hidden then show css3 loader
	jQuery('.filterable_wrapper .filterable_grid, .portfolio_filter_options').hide();
	jQuery('.filterable_wrapper').prepend('<div class="loading_icon_wrapper"><div class="loader_signal skin_border"></div></div>');
	jQuery(".blog_posts_wrapper.filterable_wrapper").addClass("masonry_loading");
	// initialize Isotope after all images have loaded
	var $container = jQuery('.filterable_grid').imagesLoaded( function() {
		jQuery('.portfolio_filter_options').fadeIn();
		jQuery('.filterable_wrapper .filterable_grid').fadeIn();
		jQuery('.loading_icon_wrapper').not('.blog_posts_wrapper.filterable_wrapper .loading_icon_wrapper').remove();
		// apply fitvids to all video banners
		jQuery(".blog_posts_wrapper.filterable_wrapper .video_fit_container").fitVids();

		// apply owl carousel for ltr an rtl content
		jQuery(".blog_posts_wrapper.filterable_wrapper .owl-carousel").owlCarousel({
				items: 1,
				loop: true,
				nav: true,
				dots: false,
				autoHeight: true,
				animateOut: 'fadeOut',
				animateIn: 'fadeIn',
				navText: "",
				rtl: jQuery('body.rtl').length ? true : false
		});

		$container.isotope({
			// options
			itemSelector : '.filterable_item',
			transformsEnabled: false,
			isOriginLeft: jQuery('body.rtl').length ? false : true
		});

	});

	// start portfolio projects filter
	if(jQuery('.portfolio_filter_options').length >= 1) {
		var $container = jQuery('.portfolio_grid.filterable_portfolio_grid');
		var $optionSets = jQuery('.portfolio_filter_options ul'),
		$optionLinks = $optionSets.find('a');

		$optionLinks.click(function(){
			var $this = jQuery(this);
			// don't proceed if already selected
			if ( $this.closest('li').hasClass('active') ) {
				return false;
			}
			var $optionSet = $this.parents('.option-set');
			$optionLinks.closest('li').removeClass('active');
			$this.closest('li').addClass('active');

			// make option object dynamically, i.e. { filter: '.my-filter-class' }
			var options = {},
			key = $optionSet.attr('data-option-key'),
			value = $this.attr('data-option-value');
			// parse 'false' as false boolean
			value = value === 'false' ? false : value;
			options[ key ] = value;
			if ( key === 'layoutMode' && typeof changeLayoutMode === 'function' ) {
				// changes in layout modes need extra logic
				changeLayoutMode( $this, options )
			} else {
				// otherwise, apply new options
				$container.isotope( options );
			}
			return false;
		});
	}
	// end filter

	// apply owl carousel for ltr an rtl content
	var $creativitycarousel = jQuery('.owl-carousel').not(".blog_posts_wrapper.filterable_wrapper .owl-carousel").imagesLoaded( function() {
		$creativitycarousel.owlCarousel({
			items: 1,
			loop: true,
			nav: true,
			dots: false,
			autoHeight: true,
			animateOut: 'fadeOut',
			animateIn: 'fadeIn',
			navText: "",
			rtl: jQuery('body.rtl').length ? true : false
		});
	});


	// check header height to be used in pinning items on the screen
	// to make sure that item is not pinned behind the header
	var $header_height = 0;
	$header_height = jQuery('.fixed_header .header_below').height() + jQuery('#wpadminbar').height();

	// apply pin using stickit
	jQuery('.creativity_sticky_sidebar, .pinned_image, .blog_social_share').stickit({
		top: $header_height + 10
	});
	
}
jQuery( document ).ready( readyFn );

jQuery( window ).load(function() {
	// initialize Isotope after all images have loaded
	var $container = jQuery('.blog_posts_wrapper.filterable_wrapper .filterable_grid').imagesLoaded( function() {
		jQuery(".blog_posts_wrapper.filterable_wrapper").removeClass('masonry_loading');
		jQuery(".blog_posts_wrapper.filterable_wrapper .loading_icon_wrapper").remove();
		// apply fitvids to all video banners
		jQuery(".blog_posts_wrapper.filterable_wrapper .video_fit_container").fitVids();
		$container.isotope({
			// options
			transformsEnabled: false,
			isOriginLeft: jQuery('body.rtl').length ? false : true
		});
	});
});

